import { Dropdown } from "./components/dropdown/Dropdown";

function App() {
  return (
    <div className="App">
      <Dropdown
        title="Selecione seu Pokemon Inicial"
        options={["Bubassaur", "Squirtle", "Charmelon"]}
        onSelect={(value) => console.log(value)}
      />
    </div>
  );
}

export default App;
